import { useSpring, animated } from "react-spring";
import styled from "styled-components";
import { Button } from "../components";
import Theme from "../theme";

const Nav_Button = (props) => Button({ type: "Nav", ...props });

const Container = animated(styled.div`
  position: fixed;
  width: 100%;
  z-index: 99;
  background-color: ${Theme.colors.c1};
`);

function Nav({ show }) {
  const { y } = useSpring({
    y: show ? "translateY(0%)" : "translateY(-100%)",
  });
  return (
    <Container style={{ transform: y }}>
      <Nav_Button>Sports</Nav_Button>
      <Nav_Button>Roster</Nav_Button>
      <Nav_Button>Contact</Nav_Button>
      <Button type="small">Login</Button>
    </Container>
  );
}

export default Nav;
